  false,\n\t\"url\": null,\n\t\"notes\": \"As suggested by the GIS Technical Advisory
  Committees DASC subcommittee, the DASC staff has imported and converted the U.S.
  Bureau of Census 1992 Tiger Line Files into ESRI's Arc/Info software. The purpose
  of this conversion was to derive a subset of coverages from the Tiger Files that
  would be of wide use by DASC clientele. These coverages reflect only a portion of
  the possible themes that could be created from TIiger and serve as a common ground
  for all to work from and should be customized for each of the users individual needs.
  None of the coverages have been edited from the original Tiger line files. DASC
  Tiger coverages are provided \"as-is,\" please submit any corrections or errors
  to DASC so the dataset can be corrected.\",\n\t\"license_title\": null,\n\t\"extras\":
